import './App.css';
import {Button} from "react-bootstrap";
import{useNavigate} from "react-router-dom";
import Header from './components/header';
import AddTimeTable from './components/AddTimeTable';
import AllTimeTables from './components/alltimetables';
import {Switch,Route} from "react-router-dom"



function App() {

  const navigate = useNavigate();
  return (
  <>
  <Header/>
       <Router>

      <Button onClick={() => navigate("create")}>Add Time Table</Button><br/><br/><br/>

      <Button onClick={() => navigate("all")}>All TimeTables</Button>




      <Routes path="/create" element={<AddTimeTable/>}/>

      <Routes path="/all" element={<AllTimeTables/>}/>


    </Router>
</>










  );
}


export default App;
